class Message extends Component
{

    constructor()
    {
        super()
        this.state={
            message: 'Hello All!'
        }
    }

    render()
    {
        return (
        <div>
            <h2>{this.state.message}</h2>;
            <button>subscribe</button>;
        </div>
        )
    }
}

export default Message;
